import React from 'react';
import './SongInfoCard.css';

const SongInfoCard = () => {
  return (
    <div className="song-info-card">
      <h3>Song of the Day: Paranoya</h3>
      <p><strong>Artist:</strong> Koorosh</p>
      <p><strong>Background:</strong> Paranoya was inspired by the growing global concern around surveillance and privacy...</p>
      <p><strong>Cultural Impact:</strong> The song gained significant attention during protests...</p>
    </div>
  );
};

export default SongInfoCard;
